import React from 'react'

const Book = ({listItem}) => {
    // console.log( listItem.volumeInfo)
    return (
        <div>
            {listItem.volumeInfo.title}
            {listItem.volumeInfo.author&&
            listItem.volumeInfo.author.length>0&&(
                listItem.volumeInfo.author.map((author, i)=>(
                    <p>{author}</p>
                ))
            )}
        </div>
    )
}

export default Book
